import React, { Component } from 'react';
import Navbar2 from '../components/Navbar2';
import {Link} from 'react-router-dom';
import praktikum from '../assets/1.png'
import upload from '../assets/2.png'

const sizeimg = {
    height : '200px',
    width : '220px'
};

class Menu extends Component {
    state = {  }
    render() { 
        return ( 
            <section>
                <Navbar2 />
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <div className='container-fluid'>
                    <div className='row'>
                        <div className='col-2'></div>
                        <div className='col-2'>
                            <Link to='/Praktikum'> 
                                <div className="card">
                                    <img src={praktikum} style={sizeimg} className='card-img-top' alt='card-image' />
                                    <div className="card-body">
                                        <h5 style={{color:'black'}} className="card-text text-center">Mulai Praktikum</h5>
                                    </div>
                                </div>
                            </Link>
                        </div>
                        <div className='col-2'>
                            <Link to='/Praktikum'> 
                                <div className="card">
                                    <img src={praktikum} style={sizeimg} className='card-img-top' alt='card-image' />
                                    <div className="card-body">
                                        <h5 style={{color:'black'}} className="card-text text-center">Mulai Praktikum</h5>
                                    </div>
                                </div>
                            </Link>
                        </div>
                    </div>
                </div>
            </section>
         );
    }
}

export default Menu;
